    <g *ngFor="let city of cities">
      <circle
        [class]="'circle circle-' + city.color"
        [id]="city.name"
        [attr.cx]="city.left" [attr.cy]="city.top"
        r="5"/>
      <text [class]="'city-text city-text-' + city.color" [attr.x]="city.left + 7"
            [attr.y]="city.top">{{city.name}}</text>
      <g *ngFor="let connectedCity of city.connectedCities">
        <line [attr.x1]="city.left" [attr.y1]="city.top"
              [attr.x2]="citiesMap[connectedCity].left" [attr.y2]="citiesMap[connectedCity].top"
        class="line"/>
      </g>
    </g>
